import React, {useState} from "react";
import {Card, Col, Row, Tabs, TabsProps, Button, Space} from "antd";
import {ChatBot} from "../ChatBot";
import Title from "antd/es/typography/Title";
import Meta from "antd/lib/card/Meta";
import './Additional.scss';


export const ChatBotLayout = (props) => {
  const {content} = props;

  const [hide, setHide] = useState<boolean>(props?.toggleFlag);

  const [activeTab, setActiveTab] = useState<number>(1);

  const tabs = [
    {key: '1', label: 'Home', title: 'Virtual CSM', description: 'I am your virtual Assistant'},
    {key: '2', label: 'Ask AI', title: 'Ask AI', description: 'Knowledge Base FAQs'},
    {key: '3', label: 'Navigate AI', title: 'Navigate AI', description: 'Navigate AI'},
    {key: '4', label: 'Query AI', title: 'Query AI', description: 'Data & Insights'}
  ];


  const chatBotDiv = () => {
    return React.createElement('chat-bot-root', {id: "chat-bot-root", class: "chat-bot-root"}, <ChatBot></ChatBot>);
  }

  const onChange = (key: string) => {
    setActiveTab(Number(key));
  };

  const home = () => {
    return(
      <>

        <Row className="banner-style">
            <iframe height="280" style={{width: '100%'}} src="https://drive.google.com/file/d/1qJdOaJGQro3hsegMd768AdkQnZsMlUSE/preview" allow="autoplay"></iframe>
        </Row>
          <Row className="cards-style orange-border" onClick={() => {
              onChange('2');
          }}>
            <Col span={6} className="card-inner orange-linear">
            <img src='data:image/svg+xml;base64,' width={42} height={42}/>
            </Col>
            <Col span={18} style={{padding:"10px"}}>
              <h3 className="orange">Ask AI</h3>
              <p>Knowledge Base FAQs</p>
            </Col>
          </Row>

          <Row className="cards-style blue-border" onClick={() => {
              onChange('3');
          }}>
              <Col span={6} className="card-inner blue-linear">
                  <img src='data:image/svg+xml;base64,' width={42} height={42}/>
              </Col>
              <Col span={18} style={{padding:"10px"}}>
                  <h3 className="blue">Navigate AI</h3>
                  <p>Navigation AI</p>
              </Col>
          </Row>

          <Row className="cards-style orange-border" onClick={() => {
              onChange('4');
          }}>
          <Col span={6} className="card-inner orange-linear">
            <img src='data:image/svg+xml;base64,' width={42} height={42}/>
          </Col>
            <Col span={18} style={{padding:"10px"}}>
              <h4 className="orange">Query AI</h4>
              <p>Data and Insights</p>
            </Col>
          </Row>
      </>
    );
    return tabs.map((tab) => {
      return (
          <>

            <Row align="middle">
              <Col span={24} onClick={() => {
                onChange(tab.key.toString());
              }}>
                <Title>{tab.title}</Title>
                <Card
                    hoverable
                    style={{width: 240, backgroundColor: 'rgb(231,230,230)'}}
                >
                  <Meta description={tab.description} />
                </Card>
              </Col>
            </Row>
          </>
      )
    });
  };

  /**
   * Toggle right side panel visibility
   */
  const togglePanel = () => {
    if (props.toggleHandler) props.toggleHandler(hide, "header");
  };

  const renderTitle = () => {
    let title = ''
    tabs.map((tab) => {
      if(Number(tab.key) === Number(activeTab)) {
        title = tab.title;
      }
    });
    return (
        <Row align="middle">
          <Col span={24}>
            <Title level={2}>{title}</Title>
          </Col>
        </Row>
    );
  }

  return (
      <div className="uda-container uda-clear uda-cards-scroller uda_exclude">
        <div
            className="uda-ribbon-arrow flex-card flex-center uda_exclude"
            id="uda-close-panel"
            onClick={() => togglePanel()}
        >
          <img alt="UDA-Logo" className="uda_exclude"
               src="data:image/png;base64,"/>
        </div>
        <Row justify="start" style={{background:"#f3f3f3", marginTop:"50px"}}>
            <Col span={6} style={{background:"#313e9c", borderRadius:"5px", display:"flex", alignItems:"center", justifyContent:"center" }}>
              <img src='data:image/svg+xml;base64,' width={52} height={52}/>
            </Col>
            <Col span={18} style={{paddingLeft:"20px"}}>
              <h2 style={{margin:"0px"}}>Virtual SCM</h2>
              <p style={{color:"#7e7e7e"}}>I am your virtual Assistant</p>
            </Col>
        </Row>
        <Tabs centered activeKey={activeTab.toString()} size={`large`} items={tabs} onChange={onChange}/>

        {activeTab !== 1 && renderTitle()}

        {activeTab === 1 && home()}
        {activeTab === 3 && content}

        <div style={{display: (activeTab === 2 || activeTab === 4) ? 'block' : 'none'}}>
          {chatBotDiv()}
        </div>

      </div>
  );

}
